class Solution:
    def __init__(self):
        self.dp= []

    def numSubmatrixSumTarget(self,matrix, target) -> int:
        n= len(matrix)
        m= len(matrix[0])
        self.dp= [[0]*m for _ in range(n)]
        cnt=0
        for i in range(n):
            s=0
            for j in range(m):
                cnt+=1
                self.dp[i][j]= s+matrix[i][j]+(self.dp[i-1][j] if i>=1 else 0)
                s+=matrix[i][j]

        #[print(*el) for el in self.dp]
        ans=0
        
        for uy in range(n):
            for dy in range(uy, n):
                for ux in range(m):
                    for dx in range(ux,m): # 25502500
                        cnt+=1
                        tmp=self.dp[dy][dx]- (self.dp[dy][ux-1] if ux>=1 else 0)- (self.dp[uy-1][dx] if uy>=1 else 0) + (self.dp[uy-1][ux-1] if uy>=1 and ux>=1 else 0)
                        #print(uy, ux, dy, dx, ' ',tmp)
                        if tmp== target:
                            ans+=1
        print(cnt)
        return ans
